import React, { useEffect } from 'react';
import sigma from 'sigma';
import 'sigma/build/plugins/sigma.parsers.csv.min.js';

const SigmaGraph = () => {
  useEffect(() => {
    const sigmaInstance = new sigma({
      container: 'sigma-container',
      settings: {
        defaultNodeColor: '#ec5148',
        edgeColor: 'default',
        defaultEdgeColor: '#999'
      }
    });

    sigma.parsers.csv('data.csv', sigmaInstance, function() {
      console.log('Graph loaded successfully!');
      sigmaInstance.refresh();
    });
  }, []);

  return (
    <div id="sigma-container" style={{ width: '800px', height: '600px', border: '1px solid #ccc' }}>
      Sigma Graph will be rendered here
    </div>
  );
};

export default SigmaGraph;
